import React from 'react'
import Avatar from '@mui/material/Avatar';
import boy from '../component/assets/Ezz.png';
import Button from '@mui/material/Button';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import Tabs from '@mui/material/Tabs';
import { createTheme, ThemeProvider } from '@mui/material/styles';


import "./Pagesstyle.css"
import Leftbar from '../component/Leftbar';

export default function Profile() {
    const [value, setValue] = React.useState('1');

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    return (
    <div id="profile">
        <Leftbar></Leftbar>
        <div id="top">

        <Avatar id="img" sx={{width:160,height:160}} src={boy}/>

        <h2 id="name">Ezz_Kalash</h2>
        <Button id="butt" variant="contained" >Edit Profile</Button>
            <Button id="butt" variant="contained">View actions</Button>
            <img src={SettingsOutlinedIcon} alt="" />

            <div id="stats">
            <p id="p">5 Posts</p>
            <p id="p">211 follower</p>
            <p id="p">300 Following</p>
            </div>
            <div id="bio">
            <p id="p">ezzalden kalash</p>
            <p id="p">CSE | AAUP</p>
            </div>
            </div>
            <div className='profile_posts'>
            <Box sx={{ width: '100%'}}>
      <Tabs
        value={value}
        onChange={handleChange}
        aria-label="wrapped label tabs example"
        indicatorColor="secondary"
      >
        <Tab value="one" label="Posts" sx={{ color: 'white',paddingRight:10,paddingLeft:10,textAlignLast:"center"}}/>
        <Tab value="two" label="reels" sx={{ color: 'white',paddingRight:10,paddingLeft:10}} />
        <Tab value="three" label="Tagged" sx={{ color: 'white',paddingRight:10,paddingLeft:10}} />
      </Tabs>
    </Box></div>





        </div>
  )
}
